import data from "../data.json";
const initialState = {
  journalData: data,
};

const journalAppReducer = (state = initialState, action) => {
  switch (action.type) {
    case 1:
      return { ...state };

    default:
      return { ...state };
  }
};
export default journalAppReducer;
